// ProgressIndicator.js
import React from 'react';
import './ProgressIndicator.css'; // Import your styles

const ProgressIndicator = ({ currentStep }) => {
  const steps = ['1', '2', '3', '4']; // Adjust based on the number of questions

  return (
    <div className="progress-indicator">
      {steps.map((step, index) => (
        <div
          key={index}
          className={`circle ${currentStep > index ? 'filled' : ''}`}
        >
          {step}
        </div>
      ))}
    </div>
  );
};

export default ProgressIndicator;
